import App from "next/app";
import Layout from "../components/_App/Layouts";
import face from '../static/logo.svg';


class MyApp extends App {
  render() {
    const { Component } = this.props;
    return ( 
    <Layout>
     <Component />
    </Layout>
    );
  }
}

export default MyApp;
